import './App.css';
import Home from './pages/Home'
import SignUp from './pages/SignUp';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/">
            <SignUp/>
          </Route>
        </Switch>
        {/* <Switch>
          <Route path="/signup">
            <SignUp/>
          </Route>
        </Switch> */}
      </div>
    </Router>
  );
}

export default App;
